    number : 63,
  },
  {
    id: "m3",
    name: "maharashtra",

    number: 85,
  },
  {
    id: "m4",
    name: "Kerala",

    number: 56,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => (
    <MealItem key={meal.id} name={meal.name} number={meal.number} />
  ));

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
